(22, '1', '<p><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">In baseball, the batting average is defined as the ratio of a player&rsquo;s&nbsp;<em>hits</em>&nbsp;to&nbsp;<em>at bats</em>. If a player had anywhere from 4 to 6&nbsp;<em>at bats</em>&nbsp;in a recent game and had anywhere from 2 to 3&nbsp;<em>hits</em>&nbsp;in the same game, the player&rsquo;s actual batting average for that game could fall anywhere between</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '0.25 and 1.00  ', '0.25 and 0.75  ', '0.33 and 0.75  ', '0.33 and 0.50  ', '0.50 and 0.66  ', 2, '<p>1. The ratio of a batting average is a fraction. As you decrease the numerator or increase the denominator, the fraction becomes smaller. Likewise, as you increase the numerator or decrease the denominator, the fraction becomes larger. 2. In the case of a batting average, the numerator is &quot;hits&quot; (H) while the denominator is &quot;at bats&quot; (B). Thus, the ratio we are looking at is: H/B, where 2</p>\r\n', '1.50', 'yes', '2023-04-10', '2023-04-10', ''),
(23, '1', '<p><span style=\"font-size:10.5pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">In a recent head-to-head run-off election, 12,000 absentee ballets were cast. 1/3 of the absentee ballets were thrown out and 1/4 of the remaining absentee ballets were cast for Candidate A. How many absentee votes did Candidate B receive?</span></span></span></span></p>\r\n', '2,000 ', '3,000  ', '6,000 ', '8,000  ', '9,000', 3, '1.	Starting with 12,000 ballets, 1/3 were thrown out, leaving 2/3 still valid:\r\n12,000 * (2/3) = 8,000 valid ballets.\r\n2.	Of those valid ballets, since 1/4 went to A, the other 3/4 must have gone to B since this is a head-to-head run-off election.\r\n8,000 * (3/4) = 6,000 valid ballets for Candidate B.\r\nThe correct answer is C.\r\n', '1.00', 'yes', '2017-06-15', '0000-00-00', ''),
(24, '1', '<p><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Last month a certain music club offered a discount to preferred customers. After&nbsp;the first compact disc purchased, preferred customers paid $3.99 for each<br />\r\nadditional compact disc purchased. If a preferred customer purchased a total of 6&nbsp;compact discs and paid $15.95 for the first compact disc, then the dollar amount<br />\r\nthat the customer paid for the 6 compact discs is equivalent to which of the&nbsp;following?</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\"><input name=\"A\" type=\"radio\" value=\"option one\" />&nbsp;one</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\"><input name=\"A\" type=\"radio\" value=\"option2\" /> two</span></span></p>\r\n', '5(4,00)+15.90', '5(4,00)+15.95', '5(4,00)+16.00', '5(4,00-0.01)+15.90', '5(4,00-0.05)+15.95', 1, '<p>The cost of the 6 compact discs, with $15.95 for the first one and $3.99 for the other 5 discs, can be expressed as 5(3.99)+15.95 . It is clear from looking at the answer choices that some regrouping of the values is needed because none of the answer choices uses $3.99 in the calculation. If $4.00 is used instead of $3.99, each one of the 5 additional compact discs is calculated at $0.01 too much, and the total cost is 5(0.01)=$0.05 too high. There is an overage of $0.05 that must be subtracted from the $15.95, or thus $15.95-$0.05=$15.90. Therefore, the cost can be expressed as 5(4.00) + 15.90.</p>\r\n', '2.00', 'yes', '2023-04-10', '2023-04-10', ''),
(25, '1', '<p>The average (arithmetic mean) of the integers from 200 to 400, inclusive, is how<br />\r\nmuch greater than the average of the integers from 50 to 100, inclusive?</p>\r\n', '150', '175', '200', '225', '300', 4, 'In the list of integers from 200 to 400 inclusive, the middle value is 300. For every\r\ninteger above 300, there exists an integer below 300 that is the same distance away\r\nfrom 300; thus the average of the integers from 200 to 400, inclusive, will be kept\r\nat 300. In the same manner, the average of the integers from 50 to 100, inclusive,\r\nis 75. The difference is 300-75=225.', '2.00', 'yes', '2017-06-15', '2017-06-15', ''),
(27, '1', '<p>The product of all the prime numbers less than 20 is closest to which of the<br />\r\nfollowing powers of 10?</p>\r\n', '109 ', '108', '107 ', '106 ', '105', 3, 'The prime numbers less than 20 are 2, 3, 5, 7, 11, 13, 17, and 19. Their product is 9,699,690. This is closest to 10000000\r\n', '4.00', 'yes', '2017-06-15', '0000-00-00', ''),
(28, '1', '<p>If<strong><span style=\"color:#1abc9c\"> n</span></strong> is the product of the integers from <strong><span style=\"color:#1abc9c\">1</span></strong> to <strong><span style=\"color:#1abc9c\">8</span></strong>, inclusive, how many different prime<br />\nfactors greater than 1 does <span style=\"color:#1abc9c\"><strong>n</strong></span> have?</p>\n', 'Four', 'Five ', 'Six ', 'Seven', 'Eight', 1, '<p>If n is the product of the integers from 1 to 8, then its prime factors will be the prime numbers from 1 to 8. There are four prime numbers between <strong><span style=\"color:#1abc9c\">1 </span></strong>and <strong><span style=\"color:#1abc9c\">8</span></strong>: <span style=\"color:#e74c3c\">2, 3, 5</span>, and <span style=\"color:#e74c3c\">7</span>.</p>\n', '2.00', 'yes', '2021-06-05', '0000-00-00', ''),
(35, '1', '<p>Of the 60 researchers in a workgroup, 40 percent will be assigned to Team A and<br />\r\nthe remaining 60 percent to Team B. However, 70 percent of the researchers prefer<br />\r\nTeam A and 30 percent prefer Team B. What is the lowest possible number of<br />\r\nresearchers who will NOT be assigned to the team they prefer?</p>\r\n', '15', '17', '20', '25 ', '30', 1, '<p>The number of researchers assigned to Team A will be (0.40)(50)=20, and so 30 will be assigned to Team B. The number of researchers who prefer Team A (0.70)(50)=35 is , and the rest, 15, prefer Team B. If all 15 who prefer Team B are assigned to Team B, which is to have 30 researchers, then 15 who prefer Team A will need to be assigned to Team B. Alternatively, since there are only 20 spots on Team A, 35 &acirc;&circ;&rsquo; 20 = 15 who prefer Team A but will have to go to Team B instead.</p>\r\n', '4.00', 'yes', '2023-04-07', '2023-04-07', ''),
(36, '1', '<p>The positive two-digit integers x and y have the same digits, but in reverse order.<br />\r\nWhich of the following must be a factor of x + y?</p>\r\n', '6', '9', '10', '11', '14', 4, 'Let m and n be digits. If x = 10m + n, then y = 10n + m. Adding x and y gives x + y = (10m + n) + (10n + m) = 11m + 11n = 11(m + n), and therefore 11 is a factor of x + y.', '1.00', 'yes', '2017-06-15', '0000-00-00', ''),
(63, '1', '<p>Asurge in new home sales and a drop in weekly<br />\r\nunemployment <u>claims suggest that the economy might<br />\r\nnot be as weak as some analysts previously thought.</u></p>\r\n', 'claims suggest that the economy might not be as weak as some analysts previouslycthought', ' claims suggests that the economy might not be so weak as some analysts have previously thought ', 'claims suggest that the economy might not be as weak as have been previously thought by some analysts ', 'claims, suggesting about the economy that it might not be so weak as previously thought by some analysts ', 'claims, suggesting the economy might not be as weak as previously thought to be by some analysts', 1, 'The plural subject of this sentence {surge and drop)\r\nrequires a plural verb, suggest. The object of this\r\nverb, the clause beginning with that, should be\r\npresented in as clear and direct a manner as\r\npossible.\r\nA Correct. The plural subject is matched with\r\na plural verb.\r\nB The singular verb suggests does not match\r\nthe plural subject of the sentence.\r\nC The sentence offers no plural subject to fit\r\nthe passive verb have been thought.\r\nD This construction is awkward, wordy, and\r\nimprecise; it also lacks a main verb; there is\r\nno reason to use passive voice, and suggesting\r\nabout the economy that it might... introduces\r\nextra words that contribute nothing to the\r\nmeaning of this sentence fragment.\r\nE The passive construction makes this\r\nunnecessarily wordy; the lack of a main verb\r\nmakes this a sentence fragment.\r\nThe correct answer is A.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(65, '1', '<p>Warning that computers in the United States are not<br />\r\nsecure, the National Academy of Sciences has urged<br />\r\nthe nation to revamp computer security procedures,<br />\r\ninstitute new emergency response teams, <u>creating a<br />\r\nspecial nongovernment organization to take</u> charge of<br />\r\ncomputer security planning.</p>\r\n', 'creating a special nongovernment organization to take', 'creating a special non government organization that takes ', 'creating a special non government organization for taking ', 'and create a special non government organization for taking ', 'and create a special nongovernment organization to take', 5, 'This sentence contains a list of three elements,\r\nall of which should be parallel. The last element\r\nshould be preceded by the conjunction and. In\r\nthis sentence, the last element must be made\r\nparallel to the previous two: to (1) revamp computer\r\nsecurity procedures, (2) institute new emergency\r\nresponse iteams,,and{3) create a special\r\nnon government organization to take charge of\r\ncomputer security planning. Omitting and causes\r\nthe reader to anticipate still another element in\r\nthe series when there is none. Using the participle\r\ncreating not only violates parallelism but also\r\ncauses misreading since the participial phrase\r\ncould modify the first part of the sentence. To\r\ndoes not need to be repeated with institute and\r\ncreate because it is understood.\r\nCreating is not parallel to to revamp and\r\ninstitute; and is needed in this series.\r\nB Creating violates the parallelism of the\r\nprevious two elements; and is needed in this\r\nseries; since the organization does not yet\r\nexist, that takes is illogical.\r\nC Creating is not parallel to to revamp and\r\ninstitute\', and is needed in this series; to has\r\nthe sense of in order to, but/or taking is\r\nneither precise nor idiomatic.\r\nD In the construction create ...to take, the\r\nsense of to is in order to;for taking is not\r\nidiomatically correct.\r\nCorrect. The three elements in the series are\r\nparallel in this sentence, and the last is\r\npreceded by and.\r\nThe correct answer is E.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(67, '1', '<p>Retail sales rose 0.8 of 1 percent in August,<br />\r\nintensifying expectations <u>that personal spending in<br />\r\nthe Julv-September quarter more than doubled that<br />\r\nof</u> the 1.4 percent growth rate in personal spending<br />\r\nfor the previous quarter.</p>\r\n', 'that personal spending in the July-September quarter more than doubled that of ', 'that personal spending in the July-September quarter would more than double ', 'of personal spending in the July-September quarter, that it more than doubled ', 'of personal spending in the July-September quarter more than doubling that of ', 'of personal spending in the July-September quarter, that it would more than double that of', 2, 'The sentence explains the expectations that\r\nresulted from a past retail sales trend. Since\r\nexpectations look to the future but are not yet\r\nrealized, the relative clause explaining these\r\nexpectations should be conditional, employing\r\nthe auxiliary verb would.\r\nA The simple past-tense verb form does not\r\nexpress the forward-looking sense of\r\nexpectations.\r\nB Correct. By using the verb would double,\r\nthis concise sentence indicates that the\r\nexpectation has not yet been realized.\r\nC This construction is awkward, announcing\r\nthe topic { personal spending) and then\r\nelaborating in a relative clause that restates\r\nthis topic as //.\r\nD Although this option is not technically\r\nwrong,it is less clear and graceful than (B).\r\nE Like (C), this sentence is awkward and\r\nunnecessarily wordy, announcing the topic\r\nand then using an additional clause to\r\nelaborate on it.\r\nThe correct answer is B.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(68, '1', '<p>The Iroquois were primarily planters, <u>but supplementing</u><br />\r\ntheir cultivation of maize, squash, and beans with<br />\r\nfishing and hunting.</p>\r\n', 'but supplementing ', 'and had supplemented ', 'and even though they supplemented ', 'although they;supplemented ', 'but with supplementing', 4, 'The participle supplementing would normally be\r\nexpected to modify the first clause, describing or\r\nextending its meaning, but the logic of this\r\nsentence demands a contrast, not an extension.\r\nConsequently, the second part of the sentence\r\nmust be revised to emphasize the contrast\r\nproperly. The logic of the sentence also argues\r\nagainst a construction that would set the two\r\nclauses and the importance of their content equal\r\nwhen they clearly should not be. The best\r\nsolution is to have the main clause describe the\r\nprimary activity, and a subordinate clause,\r\nalthough they supplemented, describe the\r\nsupplementary activity.\r\nThe construction using supplementing\r\nfails to support the intended meaning of\r\nthe sentence.\r\nB And does not convey contrast; had\r\nsupplemented is the past perfect tense but\r\nthe simple past is required to match were.\r\nC And does not convey contrast and should be\r\nomitted; and even though creates a sentence\r\nfragment.\r\nD Correct. Using although creates a subordinate\r\nclause in this sentence and logically links that\r\nclause with the main clause; the simple past\r\nsupplemented parallels the simple past were.\r\nE But with is awkward and unclear*\r\nsupplementing is a modifier when a\r\ncontrasting clause is needed.\r\nThe correct answer is D.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(69, '1', '<p><u>As contrasted with the honevbee,</u>&nbsp;the yellow jacket<br />\r\ncan sting repeatedly without dying and carries a<br />\r\npotent venom that can cause intense pain.</p>\r\n', 'As contrasted with the honeybee, ', 'In contrast to the honeybee\'s,', 'Unlike the sting of the honeybee,', 'Unlike that of the honeybee, ', 'nlike the honeybee,', 5, 'The intent of the sentence is to contrast the\r\nhoneybee and the yellow jacket. Correct idioms\r\nfor such a contrast include in contrast with x,y; in\r\ncontrast to x,y; and unlike x,y. In all these idioms,\r\nx and y must be grammatically and logically\r\nparallel.As contrasted with is not a correct idiom.\r\nA As contrasted with is not a correct idiom.\r\nB Because of its apostrophe, the honeybee\'s is\r\nnot parallel to theyellow jacket.\r\nC The sting of the honeybee is not parallel to the\r\nyellow jacket.\r\nD That of the honeybee is not parallel to the\r\nyellow jacket.\r\nE Correct. This sentence uses a correct idiom,\r\nand the honeybee is properly parallel to the\r\nyellow jacket.\r\nThe correct answer is E.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(71, '1', '<p>New data from United States Forest Service ecologists show <u>that for every dollar<br />\r\nspent on controlled small-scale burning, forest thinning, and the training of firemanagement<br />\r\npersonnel, it saves seven dollars that would not be spent on having to<br />\r\nextinguish</u> big fires.</p>\r\n', 'that for every dollar spent on controlled small-scale burning, forest thinning, and the training of fire-management personnel, it saves seven dollars that would not be spent on having to extinguish ', 'that for every dollar spent on controlled small-scale burning, forest thinning, and the training of fire-management personnel, seven dollars are saved that would have been spent on extinguishing ', 'that for every dollar spent on controlled small-scale burning, forest thinning, and the training of fire-management personnel saves seven dollars on not having to extinguish ', 'for every dollar spent on controlled small-scale burning, forest thinning, and the training of fire-management personnel, that it saves seven dollars on not having to extinguish ', 'for every dollar spent on controlled small-scale burning, forest thinning, and the training of fire-management personnel, that seven dollars are saved that would not have been spent on extinguishing', 2, 'The pronoun it (it saves seven dollars) has no referent. Making seven dollars the\r\nsubject of the clause eliminates this problem, and it also fulfills a readerâ€™s\r\nexpectation that after the phrase beginning for every dollar another specific\r\namount will be given to balance it. This change in structure also allows the\r\nawkward and wordy clause that would not be spent on having to extinguish to be\r\nrewritten so that spent balances saved: seven dollars are saved that would have\r\nbeen spent on extinguishing, and the unnecessary having to is omitted.\r\nA It has no referent; not be spent is awkward; on having to extinguish is\r\nwordy.\r\nB Correct. This sentence properly uses seven dollars as the subject of the\r\nclause to balance every dollar in the introductory phrase; the phrasing is\r\nconcise and parallel.\r\nC Saves does not have a subject; construction is not a complete sentence;\r\nnot having to extinguish is wordy and awkward.\r\nD That introduces a subordinate rather than main clause, making a sentence\r\nfragment; it has no referent; not having to extinguish is wordy and\r\nawkward.\r\nE Introductory that makes a sentence fragment; that would not have been\r\nspent on extinguishing is awkward and illogical.\r\nThe correct answer is B.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(72, '1', '<p>Like the grassy fields and old pastures that the upland sandpiper needs for feeding<br />\r\nand nesting when it returns in May after wintering in the Argentine Pampas,<u> the<br />\r\nsandpipers vanishing in the northeastern United States is a result of residential<br />\r\nand industrial development and of changes in</u> farming practices.</p>\r\n', 'the sandpipers vanishing in the northeastern United States is a result of residential and industrial development and of changes in ', 'the bird itself is vanishing in the northeastern United States as a result of residential and industrial development and of changes in', 'that the birds themselves are vanishing in the northeastern United States is due to residential and industrial development and changes to ', 'in the northeastern United States, sandpipersâ€™ vanishing due to residential and industrial development and to changes in ', 'in the northeastern United States, the sandpipersâ€™ vanishing, a result of residential and industrial development and changing', 2, 'The comparison introduced by like must be logical and clear; the point of this\r\ncomparison is that both the habitat and the bird are disappearing for similar\r\nreasons. The comparison must use comparable grammatical components; the bird\r\nitself is a noun phrase and matches the noun phrases grassy fields and old\r\npastures.\r\nA Illogically compares the sandpipers vanishing to grassy fields and old\r\npastures; omits apostrophe in sandpipersâ€™ vanishing; wordy.\r\nB Correct. This sentence properly compares the bird itself to grassy fields\r\nand old pastures; is vanishing as the verb strengthens the sentence by\r\nmaking the comparison clearer.\r\nC Does not finish the comparison begun with like but instead substitutes a\r\nclause (that the birds themselves are vanishing).\r\nD Illogically compares the sandpipersâ€™ vanishing to grassy fields and old\r\npastures; creates a sentence fragment.\r\nE Illogically compares the sandpipersâ€™ vanishing to grassy fields and old\r\npastures; creates a sentence fragment.\r\nThe correct answer is B.', '4.00', 'yes', '2017-06-16', '0000-00-00', ''),
(74, '1', '<p>Paleontologists believe that fragments of a primate<br />\r\njawbone unearthed in Burma and estimated <u>at 40 to<br />\r\n44 million years old provide evidence of</u> a crucial step<br />\r\nalong the evolutionary path that led to human beings.</p>\r\n', 'at 40 to 44 million years old provide evidence of ', 'as being 40 to 44 million years old provides evidence of ', 'that it is 40 to 44 million years old provides evidence of what was ', 'to be 40 to 44 million years old provide evidence of ', 'as 40 to 44 million years old provides evidence of what was', 4, 'The verb estimated should be followed by the\r\ninfinitive to be, not the prepositionatâ€”unless the\r\nwriter intends to indicate a location at which\r\nsomeone made the estimate. The jawbone\r\nfragments were estimated to be a certain age. The\r\nplural subject fragments requires the plural verb\r\nprovide.\r\nA Estimated is incorrectly followed by at.\r\nB Estimated should be followed by to be, not as\r\nbeing;, the singular verb provides incorrectly\r\nfollows the plural subject fragments.\r\nC Introducing a clause, that it is... , creates an\r\nungrammatical sentence; the singular verb\r\nprovides does not agree with the plural\r\nsubject fragments.\r\nD Correct. In this sentence, the verb estimated\r\nis correctly followed by the infinitive to be.\r\nE The singular verb provides does not match\r\nthe plural subject fragments.\r\nThe correct answer is D.', '4.00', 'yes', '2017-06-16', '0000-00-00', ''),
(77, '1', '<p>The Supreme Court has ruled that public universities can collect student activity<br />\r\nfees even <u>with students&rsquo; objections to particular activities, so long as the groups<br />\r\nthey give money to will be</u> chosen without regard to their views.</p>\r\n', 'with studentsâ€™ objections to particular activities, so long as the groups they give money to will be ', 'if they have objections to particular activities and the groups that are given the money are', 'if they object to particular activities, but the groups that the money is given to have to be ', 'from students who object to particular activities, so long as the groups given money are ', 'though students have an objection to particular activities, but the groups that are given the money be', 4, 'The underlined portion of the sentence fails to establish a clear relationship among\r\nuniversities, students, and groups. To which of these three does they refer? It\r\nwould appear that the universities must give the money, but they does not have a\r\nreferent. Furthermore, they is followed by their views, and in this case their must\r\nrefer to groups. Wordy and awkward phrasing as well as an unnecessary shift in\r\nverb tense (will be chosen) compound the difficulty of understanding this sentence\r\nin its original form.\r\nA With studentsâ€™ objections . . . is awkward and dense; they does not have a\r\nreferent; the future will be is incorrect since the Supreme Court has already\r\nruled.\r\nB Referent for they is student activity fees, which cannot possibly have\r\nobjections . . .; the use of and is illogical.\r\nC They refers to student activity fees rather than students; but does not\r\nhave the requisite sense of with the provision that; have to be is wordy.\r\nD Correct. In this sentence, from students who object is clear and\r\nidiomatic; so long as is used appropriately; groups given money eliminates\r\nthe problem of a pronoun without a referent; are is the proper tense.\r\nE Have an objection is an unnecessarily wordy way to say object; the verb be\r\ndoes not complete the latter part of the sentence.\r\nThe correct answer is D.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(79, '1', '<p>As an actress and, more importantly, as a teacher of acting, <u>Stella Adler was one of<br />\r\nthe most influential artists in the American theater, who trained several<br />\r\ngenerations of actors including Marlon</u> Brando and Robert De Niro.</p>\r\n', '(A) Stella Adler was one of the most influential artists in the American theater, who trained several generations of actors including ', '(B) Stella Adler, one of the most influential artists in the American theater, trained several generations of actors who include ', '(C) Stella Adler was one of the most influential artists in the American theater, training several generations of actors whose ranks included ', '(D) one of the most influential artists in the American theater was Stella Adler, who trained several generations of actors including ', '(E) one of the most influential artists in the American theater, Stella Adler, trained several generations of actors whose ranks included', 3, 'The original sentence contains a number of modifiers, but not all of them are\r\ncorrectly expressed. The clause who trained . . . describes Stella Adler, yet a relative\r\nclause such as this one must be placed immediately after the noun or pronoun it\r\nmodifies, and this clause follows theater rather than Adler. Replacing who trained\r\nwith training corrects the error because the phrase training . . . modifies the whole\r\npreceding clause rather than the single preceding noun. Several generations of\r\nactors including shows the same error in reverse; including modifies the whole\r\nphrase, but the two actors named are not generations of actors. The more limiting\r\nclause whose ranks included (referring to actors) is appropriate here.\r\nA Relative (who) clause follows theater rather than Adler; including refers\r\nto generations of actors, when the reference should be to actors only.\r\nB This construction, in which the subject is both preceded and followed by\r\nmodifiers, is awkward; the verbs should be consistently in the past tense,\r\nbut include is present tense.\r\nC Correct. In this sentence, substituting training for who trained and\r\nwhose ranks included for including eliminates the modification errors.\r\nD Introductory modifier must be immediately followed by Stella Adler, not\r\none . . .; including refers to generations of actors rather than to actors only.\r\nE Introductory modifier must be immediately followed by Stella Adler, not\r\none.\r\nThe correct answer is C.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(80, '1', '<p>In the past the country of Malvernia has relied heavily on imported oil. Malvernia<br />\r\nrecently implemented a program to convert heating systems from oil to natural<br />\r\ngas. Malvernia currently produces more natural gas each year than it uses, and oil<br />\r\nproduction in Malvernian oil fields is increasing at a steady pace. If these trends in<br />\r\nfuel production and usage continue, therefore, Malvernian reliance on foreign<br />\r\nsources for fuel is likely to decline soon.<br />\r\nWhich of the following would it be most useful to establish in evaluating the<br />\r\nargument?</p>\r\n', 'When, if ever, will production of oil in Malvernia outstrip production of natural gas?', 'Is Malvernia among the countries that rely most on imported oil? ', 'What proportion of Malverniaâ€™s total energy needs is met by hydroelectric, solar, and nuclear power? ', 'Is the amount of oil used each year in Malvernia for generating electricity and fuel for transportation increasing? ', 'Have any existing oil-burning heating systems in Malvernia already been converted to natural-gas-burning heating systems?', 4, 'Situation:-\r\nMalvernia has relied heavily on imported oil, but recently began a\r\nprogram to convert heating systems from oil to natural gas.\r\nMalvernia produces more natural gas than it uses, so it will\r\nprobably reduce its reliance on imported oils if these trends continue.\r\nReasoning:-\r\nWhich option provides the information that it would be most\r\nuseful to know in evaluating the argument? In other words, we are\r\nlooking for the option whichâ€”depending on whether it was\r\nanswered yes or noâ€”would either most weaken or most strengthen\r\nthe argument. The argument indicates that Malvernia will be using\r\nless oil for heating and will be producing more oil domestically. But\r\nthe conclusion that Malverniaâ€™s reliance on foreign oil will decline,\r\nassuming the current trends mentioned continue, would be\r\nseriously undermined if there was something in the works that was\r\nbound to offset these trends, for instance, if it turned out that the\r\ncountryâ€™s need for oil was going to rise drastically in the coming\r\nyears.\r\nA Since both counteract the need for imported oil, it makes little difference\r\nto the argument whether domestic oil production exceeds domestic natural\r\ngas.\r\nB Whether there are many countries that rely more on foreign oil than\r\nMalvernia would have little impact on whether Malverniaâ€™s need for foreign\r\noil can be expected to decline.\r\nC Since there is no information in the argument about whether Malvernia\r\ncan expect an increase or decrease from these other energy sources, it does\r\nnot matter how much they now provide.\r\nD Correct. This option provides the information that it would be most\r\nuseful to know in evaluating the argument.\r\nE The argument tells us that a program has begun recently to convert\r\nheating systems from oil to gas. So, even if no such conversions have been\r\ncompleted, the argument still indicates that they can be expected to occur.\r\nThe correct answer is D.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(81, '1', '<p>Exposure to certain chemicals commonly used in elementary schools as cleaners or<br />\r\npesticides causes allergic reactions in some children. Elementary school nurses in<br />\r\nRenston report that the proportion of schoolchildren sent to them for treatment of<br />\r\nallergic reactions to those chemicals has increased significantly over the past ten<br />\r\nyears. Therefore, either Renston&rsquo;s schoolchildren have been exposed to greater<br />\r\nquantities of the chemicals, or they are more sensitive to them than schoolchildren<br />\r\nwere ten years ago.<br />\r\nWhich of the following is an assumption on which the argument depends?</p>\r\n', 'The number of school nurses employed by Renstonâ€™s elementary schools has not decreased over the past ten years. ', 'Children who are allergic to the chemicals are no more likely than other children to have allergies to other substances. ', 'Children who have allergic reactions to the chemicals are not more likely to be sent to a school nurse now than they were ten years ago. ', 'The chemicals are not commonly used as cleaners or pesticides in houses and apartment buildings in Renston. ', 'Children attending elementary school do not make up a larger proportion of Renstonâ€™s population now than they did ten years ago.', 3, 'Argument Construction\r\nSituation:-\r\nSome children have allergic reactions to some of the chemicals\r\ncommonly used in elementary schools as cleaners and pesticides.\r\nThe number of children sent to elementary school nurses in\r\nRenston for allergic reactions to such chemicals has risen\r\nsignificantly over the past ten years.\r\nReasonong:-\r\nWhat must the argument assume? The argumentâ€™s conclusion\r\npresents just two alternatives: either the children are exposed to\r\nmore of the chemicals than children in earlier years, or they are\r\nmore sensitive. But there is a third possible explanation for the\r\nsignificant increase in school-nurse visits that the school nurses\r\nhave reported: that children are just more inclined to go to the\r\nschool nurse when they experience an allergic reaction than were\r\nchildren several years ago. For the conclusion to follow from its\r\npremises, the argument must assume that this is not the correct explanation.\r\n\r\nA If the number of elementary school nurses in Renston elementary schools\r\nhad decreased over the past ten years, that would in no way explain the rise\r\nin the proportion of children reporting to school nurses for allergic\r\nreactions.\r\nB Only school-nurse visits for allergic reactions to the cleaners and\r\npesticides used in elementary schools are in question in the argument. Of\r\ncourse there could be school-nurse visits for allergic reactions to other\r\nthings, but that issue does not arise in the argument.\r\nC Correct. This can be seen by considering whether the argument would\r\nwork if we assume that this were false, i.e., that a school-nurse visit is more\r\nlikely in such cases. As noted above, this provides an alternative to the two\r\nexplanations that the conclusion claims are the sole possibilities.\r\nD This does not need to be assumed by the argument. The argumentâ€™s\r\nconclusion suggests that children may in recent years have had greater\r\nexposure to the chemicals, not that this exposure has occurred exclusively in\r\nthe schools. The argument does not rely on this latter assumption.\r\nE The argument does not need to make this assumption. The argument is\r\nframed in terms of proportions of children having school-nurse visits for\r\ncertain allergic reactions. How many children there are or what proportion\r\nsuch children are of Renstonâ€™s total population is not directly relevant to the\r\nargument.\r\nThe correct answer is C.\r\n', '4.00', 'yes', '2017-06-16', '0000-00-00', ''),
(82, '1', '<p>Commentator: The theory of trade retaliation states that countries closed out of<br />\r\nany of another country&rsquo;s markets should close some of their own markets to the<br />\r\nother country in order to pressure the other country to reopen its markets. If every<br />\r\ncountry acted according to this theory, no country would trade with any other.<br />\r\nThe commentator&rsquo;s argument relies on which of the following assumptions?</p>\r\n', 'No country actually acts according to the theory of trade retaliation. ', 'No country should block any of its markets to foreign trade. ', 'Trade disputes should be settled by international tribunal. ', 'For any two countries, at least one has some market closed to the other. ', 'Countries close their markets to foreigners to protect domestic producers.', 4, 'Situation:- \r\nThe theory of trade retaliation is explained as the action and\r\nreaction of closing markets between trading nations; no country\r\nwould ever trade with another, the observation is offered, if every\r\ncountry acted according to the theory.\r\nReasoning:-\r\nWhat assumption underlies this argument? What makes the\r\ncommentator conclude that no country would be trading if the\r\ntheory were operative? The commentator must perceive of some\r\ncondition as a given here. The argument assumes an initial action,\r\na countryâ€™s closing of a market to a trading partner, that is followed\r\nby a reaction, the retaliatory closing of a market by that partner. In\r\nthis unending pattern of action-reaction, at least one of the two\r\ncountries must have a market closed to the other.\r\n\r\nA The argument does not assume that no country acts according to the\r\ntheory, just that not all countries do so.\r\nB The commentatorâ€™s argument is about what the theory of trade retaliation\r\npredicts, not about what trade policies countries ought to follow, and a\r\nstatement about the latter is not an assumption for the former.\r\nC This alternative scenarioâ€”trade disputes settled by international tribunal\r\nrather than by trade retaliationâ€”plays no role in the argument.\r\nD Correct. This statement properly identifies the assumption required to\r\ncreate the never-ending action-reaction pattern.\r\nE The argument does not pertain to countriesâ€™ initial reasons for closing\r\ntheir markets to foreign trade, only to the consequences of doing so.\r\nThe correct answer is D.', '3.00', 'yes', '2017-06-16', '0000-00-00', ''),
(85, '1', '<p>Networks of blood vessels in bats&rsquo; wings serve only to disperse heat generated in<br />\r\nflight. This heat is generated only because bats flap their wings. Thus<br />\r\npaleontologists&rsquo; recent discovery that the winged dinosaur Sandactylus had similar<br />\r\nnetworks of blood vessels in the skin of its wings provides evidence for the<br />\r\nhypothesis that Sandactylus flew by flapping its wings, not just by gliding.<br />\r\nIn the passage, the author develops the argument by</p>\r\n', 'forming the hypothesis that best explains several apparently conflicting pieces of evidence ', 'reinterpreting evidence that had been used to support an earlier theory', 'using an analogy with a known phenomenon to draw a conclusion about an unknown phenomenon ', 'speculating about how structures observed in present-day creatures might have developed from similar structures in creatures now extinct ', 'pointing out differences in the physiological demands that flight makes on large, as opposed to small, creatures', 3, 'Argument Evaluation\r\nSituation:-\r\nThe network of blood vessels in batsâ€™ wings is compared with a\r\nsimilar structure in the wings of the dinosaur Sandactylus to\r\nexplain how the dinosaur flew.\r\nReasoning:-\r\nHow is this argument developed? The author first shows that a\r\nphysical characteristic of batsâ€™ wings is directly related to their style\r\nof flight. The author then argues that the similar structure found in\r\nthe wings of Sandactylus is evidence that the dinosaur had a style\r\nof flight similar to that of bats. The structure of this argument is a\r\ncomparison, or analogy, between a known phenomenon (bats) and\r\nan unknown one (Sandactylus).\r\nA The evidence of the blood vessels in the wings does not conflict with other\r\nevidence.\r\nB The evidence of the blood vessels in the wings is used to support only one\r\ntheoryâ€”that Sandactylus flew by flapping its wings as well as by gliding; no\r\nevidence is discussed in relation to any earlier theory.\r\nC Correct. This statement properly identifies how the argument compares\r\nthe wings of bats and of Sandactylus in order to draw a conclusion about\r\nhow the dinosaur flew.\r\nD The argument is not about how the structures in the bats developed from\r\nthe structures in the dinosaurs, but rather about how Sandactylus flew.\r\nE The comparison between bats and Sandactylus points out similarities, not\r\ndifferences.\r\nThe correct answer is C.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(86, '1', '<p>Keith: Compliance with new government regulations requiring the installation of<br />\r\nsmoke alarms and sprinkler systems in all theaters and arenas will cost the<br />\r\nentertainment industry $25 billion annually. Consequently, jobs will be lost and<br />\r\nprofits diminished. Therefore, these regulations will harm the country&rsquo;s economy.<br />\r\nLaura: The $25 billion spent by some businesses will be revenue for others. Jobs<br />\r\nand profits will be gained as well as lost.<br />\r\nLaura responds to Keith by</p>\r\n', 'demonstrating that Keithâ€™s conclusion is based on evidence that is not relevant to the issue at hand', 'challenging the plausibility of the evidence that serves as the basis for Keithâ€™s argument ', 'suggesting that Keithâ€™s argument overlooks a mitigating consequence ', 'reinforcing Keithâ€™s conclusion by supplying a complementary interpretation of the evidence Keith cites ', 'agreeing with the main conclusion of Keithâ€™s argument but construing that conclusion as grounds for optimism rather than for pessimism', 3, 'Argument Construction\r\nSituation:-\r\nKeith argues that the cost of new regulations will result in a loss of\r\njobs and profits, hurting the national economy. Laura points out\r\nthat while one industry will suffer, others will gain by supplying the\r\ngoods and services required by the regulations.\r\nResoning:-\r\nWhat is the strategy Laura uses in the counterargument? Laura\r\nuses the same evidence, the $25 billion spent on meeting new\r\nregulations, but comes to a different conclusion. While Keith\r\nfocuses on the losses to one industry, Laura looks at the gains to\r\nother industries. By suggesting a consequence that Keith did not\r\nmention, she places the outcome in a more positive light.\r\nA Laura accepts the relevance of Keithâ€™s evidence and uses it herself when\r\nshe replies that the $25 billion spent by some businesses will be revenue for\r\nothers.\r\nB Laura does not challenge Keithâ€™s evidence; she uses the same evidence as\r\nthe basis of her own argument.\r\nC Correct. This statement properly identifies the strategy Laura employs in\r\nher counterargument. Laura points out that Keith did not consider that, in\r\nthis case, losses for one industry mean gains for others.\r\nD Laura rejects rather than reinforces Keithâ€™s conclusion; while he notes the\r\nlosses in jobs and profits that will harm the economy, she points out that\r\njobs and profits will be gained as well as lost.\r\nE Laura does not agree with Keithâ€™s main conclusion that the regulations\r\nwill harm the national economy; she argues instead that gains in other\r\nindustries will compensate for the losses in one industry.\r\nThe correct answer is C.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(87, '1', '<p>A certain cultivated herb is one of a group of closely related plants that thrive in<br />\r\nsoil with high concentrations of metals that are toxic to most other plants.<br />\r\nAgronomists studying the growth of this herb have discovered that it produces<br />\r\nlarge amounts of histidine, an amino acid that, in test-tube solutions, renders these<br />\r\nmetals chemically inert. Hence, the herb&rsquo;s high histidine production must be the<br />\r\nkey feature that allows it to grow in metal-rich soils.<br />\r\nIn evaluating the argument, it would be most important to determine which of the<br />\r\nfollowing?</p>\r\n', '(A) Whether the herb can thrive in soil that does not have high concentrations of the toxic metals ', '(B) Whether others of the closely related group of plants also produce histidine in large quantities ', '(C) Whether the herbâ€™s high level of histidine production is associated with an unusually low level of production of some other amino acid ', '(D) Whether growing the herb in soil with high concentrations of the metals will, over time, reduce their concentrations in the soil ', '(E) Whether the concentration of histidine in the growing herb declines as the plant approaches maturity', 2, 'Argument Evaluation\r\nSituation:-\r\nA certain herb and closely related species thrive in soil full of\r\nmetals toxic to most plants. The herb produces much histidine,\r\nwhich makes those metals chemically inert. Histidine production,\r\ntherefore, is largely what accounts for the herbâ€™s thriving in metalrich\r\nsoils.\r\nReasoning:-\r\nWhat evidence would help determine whether the herbâ€™s histidine\r\nproduction is what enables it to thrive in metal-rich soils? The\r\nargument is that since the herbâ€™s histidine chemically neutralizes\r\nthe metals that are toxic to most plants, it must explain why the\r\nherb can thrive in metal-rich soils. To evaluate this argument, it\r\nwould be helpful to know about the relationship between other\r\nclosely related plant speciesâ€™ histidine production and the ability to\r\nthrive in metal-rich soils. It would also be helpful to know about\r\nany other factors that might plausibly explain why the herb can thrive in those soils.\r\n\r\nA Whether or not the herb thrives in metal-free soils, histidine production\r\ncould enable it to thrive in soils that contain toxic metals.\r\nB Correct. If the closely related plants do not produce much histidine,\r\nwhatever other factor allows them to thrive in metal-rich soils would likely\r\naccount for why the herb thrives in those soils as well.\r\nC The given information suggests no particular reason to suppose that a low\r\nlevel of some unspecified amino acid would enable a plant to thrive in\r\nmetal-rich soils.\r\nD The herb might absorb metals from any metal-rich soil it grows in,\r\nregardless of why it thrives in that soil.\r\nE Whether or not histidine concentrations in the herb decline as it\r\napproaches maturity, there could still be enough histidine in the growing\r\nherb to neutralize the metals and explain why it can grow in metal-rich soil.\r\nThe correct answer is B.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(88, '1', '<p>Many people suffer an allergic reaction to certain sulfites, including those that are<br />\r\ncommonly added to wine as preservatives. However, since there are several<br />\r\nwinemakers who add sulfites to none of the wines they produce, people who would<br />\r\nlike to drink wine but are allergic to sulfites can drink wines produced by these<br />\r\nwinemakers without risking an allergic reaction to sulfites.<br />\r\nWhich of the following is an assumption on which the argument depends?</p>\r\n', 'These winemakers have been able to duplicate the preservative effect produced by adding sulfites by means that do not involve adding any potentially allergenic substances to their wine. ', 'Not all forms of sulfite are equally likely to produce the allergic reaction. ', 'Wine is the only beverage to which sulfites are commonly added. ', 'Apart from sulfites, there are no substances commonly present in wine that give rise to an allergic reaction. ', 'Sulfites are not naturally present in the wines produced by these winemakers in amounts large enough to produce an allergic reaction in someone who drinks these wines.', 5, 'Argument Construction\r\nSituation:-\r\nPeople who are allergic to certain sulfites can avoid risking an\r\nallergic reaction by drinking wine from one of the several producers\r\nthat does not add sulfites.\r\nReasoning:-\r\nOn what assumption does the argument depend? Drinking wine to\r\nwhich no sulfites have been added will not prevent exposure to\r\nsulfites if, for instance, sulfites occur naturally in wines. In\r\nparticular, if the wines that do not have sulfites added have sulfites\r\npresent naturally in quantities sufficient to produce an allergic\r\nreaction, drinking these wines will not prevent an allergic reaction.\r\nThe argument therefore depends on assuming that this is not the\r\ncase.\r\nA The argument does not require this because the conclusion does not\r\naddress allergic reactions to substances other than sulfites.\r\nB The argument specifically refers to â€œcertain sulfitesâ€ producing allergic\r\nreactions. It is entirely compatible with certain other forms of sulfites not\r\nproducing allergic reactions in anyone.\r\nC This is irrelevant. The argument does not claim that one can avoid having\r\nan allergic reaction to sulfites from any source just by restricting oneâ€™s wine\r\nconsumption to those varieties to which no sulfites have been added.\r\nD Once again, the argumentâ€™s conclusion does not address allergic reactions\r\nto substances other than sulfites in wine.\r\nE Correct. The argument relies on this assumption.\r\nThe correct answer is E.', '2.00', 'yes', '2017-06-16', '0000-00-00', '');
INSERT INTO `tbl_question` (`question_id`, `exam_id`, `question`, `first_answer`, `second_answer`, `third_answer`, `fourth_answer`, `fifth_answer`, `answer`, `reason`, `marks`, `is_active`, `added_date`, `updated_date`, `image_name`) VALUES
(89, '1', '<p>Businesses are suffering because of a lack of money available for development<br />\r\nloans. To help businesses, the government plans to modify the income-tax<br />\r\nstructure in order to induce individual taxpayers to put a larger portion of their<br />\r\nincomes into retirement savings accounts, because as more money is deposited in<br />\r\nsuch accounts, more money becomes available to borrowers.<br />\r\nWhich of the following, if true, raises the most serious doubt regarding the<br />\r\neffectiveness of the government&rsquo;s plan to increase the amount of money available<br />\r\nfor development loans for businesses?</p>\r\n', '(A) When levels of personal retirement savings increase, consumer borrowing always increases correspondingly. ', '(B) The increased tax revenue the government would receive as a result of business expansion would not offset the loss in revenue from personal income taxes during the first year of the plan. ', '(C) Even with tax incentives, some people will choose not to increase their levels of retirement savings. ', '(D) Bankers generally will not continue to lend money to businesses whose prospective earnings are insufficient to meet their loan repayment schedules. ', '(E) The modified tax structure would give all taxpayers, regardless of their incomes, the same tax savings for a given increase in their retirement savings.', 1, 'Evaluation of plan\r\nSituation:-\r\nBecause the lack of available money for development loans is\r\nharming businesses, the government plans to modify the incometax\r\nstructure, encouraging taxpayers to put more money into\r\nretirement accounts. This plan is intended to ensure that with more\r\nmoney put into these accounts, more money will in turn be\r\navailable to business borrowers.\r\nReasoning:-\r\nWhat potential flaw in this plan might prevent it from being\r\neffective? What is the expectation behind the plan? The\r\ngovernmentâ€™s plan supposes that the money invested in retirement\r\naccounts will be available to business borrowers in the form of\r\ndevelopment loans. Consider what circumstances might hinder that\r\navailability. What if consumer borrowers compete with businesses?\r\nIf it is known that, historically, increased savings in personal\r\nretirement accounts corresponds with increased consumer\r\nborrowing, then the governmentâ€™s effort to target businesses as the\r\nbeneficiaries of this plan could well fail.\r\nA Correct. This statement properly identifies a reason that the\r\ngovernmentâ€™s plan could be less effective in meeting its goal.\r\nB A predicted revenue shortfall does not directly affect the planâ€™s\r\neffectiveness in reaching its stated goal, and might be deemed an acceptable\r\ncost of achieving that goal.\r\nC As long as the total amount deposited in personal retirement accounts\r\nincreases sufficiently, the decision of some people not to increase their\r\ncontributions will not keep the plan from achieving its goal.\r\nD The plan would increase the money available specifically for development\r\nloans, not existing loans.\r\nE The universal tax savings does not affect the effectiveness of the plan.\r\nThe correct answer is A.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(91, '1', '<p>Environmentalist: The commissioner of the Fish and Game Authority would have<br />\r\nthe public believe that increases in the number of marine fish caught demonstrate<br />\r\nthat this resource is no longer endangered. This is a specious argument, as<br />\r\nunsound as it would be to assert that the ever-increasing rate at which rain forests<br />\r\nare being cut down demonstrates a lack of danger to that resource. The real cause<br />\r\nof the increased fish-catch is a greater efficiency in using technologies that deplete<br />\r\nresources.<br />\r\nThe environmentalist&rsquo;s statements, if true, best support which of the following as a<br />\r\nconclusion?</p>\r\n', 'The use of technology is the reason for the increasing encroachment of people on nature. ', 'It is possible to determine how many fish are in the sea in some way other than by catching fish. ', 'The proportion of marine fish that are caught is as high as the proportion of rain forest trees that are cut down each year. ', 'Modern technologies waste resources by catching inedible fish. ', 'Marine fish continue to be an endangered resource.', 5, 'Argument Construction\r\nSituation:-\r\nA public official argues that increased catches show that marine\r\nfish are no longer endangered. An environmentalist attacks the\r\nposition and cites technology as the cause of the increased catch.\r\nReasoning:-\r\nWhat conclusion do the environmentalistâ€™s statements support?\r\nThe environmentalist casts doubt by saying the commissioner\r\nwould have the public believe that the increased catch shows that\r\nthe fish are no longer endangered; the phrasing indicates that the\r\nenvironmentalist believes just the reverse. The environmentalist\r\ndoes believe the marine fish are endangered, and, after attacking\r\nthe commissionerâ€™s argument as specious, or false, and offering an\r\nanalogy to make that argument look ridiculous, the\r\nenvironmentalist gives an alternate explanation for the increased\r\ncatch that is consistent with that belief.\r\nA Although the environmentalist claims that technology causes peopleâ€™s\r\ngreater encroachment on nature in this single instance, there is nothing in\r\nthe argument to suggest that such encroachment caused by technology is a\r\ngeneral trend.\r\nB The environmentalistâ€™s claims imply that the number of fish caught is not\r\na reliable indicator of how many are left in the ocean but do not give any\r\nindication that it is possible to find out by any other means, either.\r\nC The environmentalist creates an analogy between fish caught and rain\r\nforest trees cut down but does not compare their proportion.\r\nD Nothing about how the fish can be used, including whether they are edible\r\nor inedible, plays any role in the environmentalistâ€™s argument.\r\nE Correct. This statement properly identifies a conclusion supported by the\r\nenvironmentalistâ€™s statements: The marine fish are endangered.\r\nThe correct answer is E.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(94, '1', '<p>Studies in restaurants show that the tips left by customers who pay their bill in<br />\r\ncash tend to be larger when the bill is presented on a tray that bears a credit-card<br />\r\nlogo. Consumer psychologists hypothesize that simply seeing a credit-card logo<br />\r\nmakes many credit-card holders willing to spend more because it reminds them<br />\r\nthat their spending power exceeds the cash they have immediately available.<br />\r\nWhich of the following, if true, most strongly supports the psychologists&rsquo;<br />\r\ninterpretation of the studies?</p>\r\n', 'The effect noted in the studies is not limited to patrons who have credit cards. ', 'Patrons who are under financial pressure from their credit-card obligations tend to tip less when presented with a restaurant bill on a tray with a credit-card logo than when the tray has no logo. ', 'In virtually all of the cases in the studies, the patrons who paid bills in cash did not possess credit cards. ', 'In general, restaurant patrons who pay their bills in cash leave larger tips than do those who pay by credit card. ', 'The percentage of restaurant bills paid with a given brand of credit card increases when that credit cardâ€™s logo is displayed on the tray with which the bill is presented.', 2, 'Argument Evaluation:-\r\nSituation\r\nStudies have found that restaurant customers give more generous\r\ntips when their bills are brought on trays bearing a credit-card logo.\r\nPsychologists speculate that this is because the logo reminds\r\ncustomers of their ability to spend more money than they have.\r\nReasoning:-\r\nWhich of the options most helps to support the psychologistsâ€™\r\nexplanation of the studies? The psychologistsâ€™ hypothesis is that\r\nthe credit-card logos on the trays bring to the minds of those who\r\ntip more the fact that they have more purchasing power than\r\nmerely the cash that they have at hand. This explanation would not\r\nbe valid even if those people who are not reminded of their own\r\nexcess purchasing powerâ€”if in fact they have any such powerâ€”\r\nwhen they see such a logo nonetheless tip more in such trays.\r\nThus, if restaurant patrons who are under financial pressure from\r\ntheir credit-card obligations do not tip more when their bills are\r\npresented on trays bearing credit-card logos, then the\r\npsychologistsâ€™ interpretation of the studies is supported.\r\nA This undermines the psychologistsâ€™ interpretation, for it shows that the\r\nsame phenomenon occurs even when the alleged cause has been removed.\r\nB Correct. This option identifies the result that would most strengthen the\r\npsychologistsâ€™ interpretation.\r\nC This undermines the psychologistsâ€™ interpretation by showing that the\r\nsame phenomenon occurs even when the alleged cause has been removed;\r\npatrons cannot be reminded of something that is not there.\r\nD To the extent that this bears on the interpretation of the study, it weakens\r\nit. Patrons using credit cards are surely aware that they have credit, and yet\r\nthey spend less generously.\r\nE This does not support the idea that being reminded that one has a credit\r\ncard induces one to be more generous, only that it induces one to use that\r\ncredit card.\r\nThe correct answer is B.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(95, '1', '<p>In an experiment, each volunteer was allowed to choose between an easy task and<br />\r\na hard task and was told that another volunteer would do the other task. Each<br />\r\nvolunteer could also choose to have a computer assign the two tasks randomly.<br />\r\nMost volunteers chose the easy task for themselves and under questioning later<br />\r\nsaid they had acted fairly. But when the scenario was described to another group of<br />\r\nvolunteers, almost all said choosing the easy task would be unfair. This shows that<br />\r\nmost people apply weaker moral standards to themselves than to others.<br />\r\nWhich of the following is an assumption required by this argument?</p>\r\n', '(A) At least some volunteers who said they had acted fairly in choosing the easy task would have said that it was unfair for someone else to do so. ', '(B) The most moral choice for the volunteers would have been to have the computer assign the two tasks randomly. ', '(C) There were at least some volunteers who were assigned to do the hard task and felt that the assignment was unfair. ', '(D) On average, the volunteers to whom the scenario was described were more accurate in their moral judgments than the other volunteers were. ', '(E) At least some volunteers given the choice between assigning the tasks themselves and having the computer assign them felt that they had made the only fair choice available to them.', 1, 'Argument Construction\r\nSituation:-\r\nIn an experiment, most volunteers chose to do an easy task\r\nthemselves and leave a hard task for someone else. They later said\r\nthey had acted fairly, but almost all volunteers in another group to\r\nwhich the scenario was described said choosing the easy task would\r\nbe unfair, indicating that most people apply weaker moral\r\nstandards to themselves.\r\nReasoning:-\r\nWhat must be true in order for the facts presented to support the\r\nconclusion that most people apply weaker moral standards to\r\nthemselves than to others? One set of volunteers said they had\r\nacted fairly in taking the easy task, whereas different volunteers\r\nsaid that doing so would be unfair. In neither case did any of the\r\nvolunteers actually judge their own behavior differently from how\r\nthey judged anyone elseâ€™s. So the argument implicitly infers from\r\nthe experimental results that most of the volunteers would judge\r\ntheir own behavior differently from someone elseâ€™s if given the\r\nchance. This inference assumes that the volunteers in the second\r\ngroup would have applied the same moral standards that those in\r\nthe first group did if they had been in the first groupâ€™s position, and\r\nvice versa.\r\nA Correct. If none of the volunteers who said their own behavior was fair\r\nwould have judged someone elseâ€™s similar behavior as unfair, then their\r\nrelaxed moral judgment of themselves would not suggest that they applied\r\nweaker moral standards to themselves than to others.\r\nB Even if this is so, the experimental results could still suggest that the\r\nvolunteers would apply weaker moral standards to themselves than to\r\nothers.\r\nC The argument would be equally strong even if volunteers who were\r\nassigned the hard task did not know that someone else had gotten an easier\r\ntaskâ€”or even if no volunteers were actually assigned the hard task at all.\r\nD Even if the moral standards applied by the volunteers who judged\r\nthemselves were as accurate as those applied by the volunteers to whom the\r\nscenario was described, the former standards were still weaker.\r\nE Even if all the volunteers in the first group had felt that all the choices\r\navailable to them would have been fair for them to make personally, they\r\nmight have applied stricter moral standards to someone else in the same\r\nposition.\r\nThe correct answer is A.', '2.00', 'yes', '2017-06-16', '0000-00-00', ''),
(96, '1', '<p>hich of the following most logically completes the argument?<br />\r\nThe irradiation of food kills bacteria and thus retards spoilage. However, it also<br />\r\nlowers the nutritional value of many foods. For example, irradiation destroys a<br />\r\nsignificant percentage of whatever vitamin B1 a food may contain. Proponents of<br />\r\nirradiation point out that irradiation is no worse in this respect than cooking.<br />\r\nHowever, this fact is either beside the point, since much irradiated food is eaten<br />\r\nraw, or else misleading, since .</p>\r\n', 'many of the proponents of irradiation are food distributors who gain from foodsâ€™ having a longer shelf life ', 'it is clear that killing bacteria that may be present on food is not the only effect that irradiation has ', 'cooking is usually the final step in preparing food for consumption, whereas irradiation serves to ensure a longer shelf life for perishable foods ', 'certain kinds of cooking are, in fact, even more destructive of vitamin B1 than carefully controlled irradiation is ', 'for food that is both irradiated and cooked, the reduction of vitamin B1 associated with either process individually is compounded', 5, 'Argument Construction\r\nSituation:-\r\nIrradiation kills bacteria but it also lowers the amount of nutrients\r\nâ€”including vitamin B1â€”in foods. Proponents try to dismiss this\r\nconcern by arguing that cooking destroys B1 as well. That point is\r\nsaid to be misleading.\r\nReasoning:-\r\nWhich option most logically completes the argument? For the\r\nproponentsâ€™ claim to be misleading it needs to be suggesting\r\nsomething about irradiation that is false. By stating that irradiation\r\ndestroys no more B1 than cooking does, the proponent seems to be\r\nsuggesting that any food that is going to be cooked might as well be\r\nirradiated because it will end up with the same amount of B1 either\r\nway. But if the effects of radiation and cooking combine to destroy\r\nmore B1 than cooking or irradiation alone would, then the\r\nproponentsâ€™ claim suggests something that is false.\r\nA This might make the assurances of the proponents less credible but it\r\ndoes not make their claim misleading.\r\nB Nothing about the proponentsâ€™ claim suggests that the only effect\r\nirradiation has is to kill bacteria.\r\nC The fact that cooking and irradiation have different purposes does not\r\nindicate that the proponentsâ€™ claim suggests something that is false.\r\nD If anything, this strengthens the proponentsâ€™ point by minimizing the\r\nrelative damage caused by irradiation.\r\nE Correct. This option most logically completes the argument.\r\nThe correct answer is E.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(97, '1', '<p>Theater Critic: The play La Finestrina, now at Central Theater, was written in Italy<br />\r\nin the eighteenth century. The director claims that this production is as similar to<br />\r\nthe original production as is possible in a modern theater. Although the actor who<br />\r\nplays Harlequin the clown gives a performance very reminiscent of the twentiethcentury<br />\r\nAmerican comedian Groucho Marx, Marx&rsquo;s comic style was very much<br />\r\nwithin the comic acting tradition that had begun in sixteenth-century Italy.<br />\r\nThe considerations given best serve as part of an argument that</p>\r\n', 'modern audiences would find it hard to tolerate certain characteristics of a historically accurate performance of an eighteenth-century play ', 'Groucho Marx once performed the part of the character Harlequin in La Finestrina ', ' in the United States the training of actors in the twentieth century is based on principles that do not differ radically from those that underlay the training of actors in eighteenth-century Italy ', ' the performance of the actor who plays Harlequin in La Finestrina does not serve as evidence against the directorâ€™s claim ', ' the director of La Finestrina must have advised the actor who plays Harlequin to model his performance on comic performances of Groucho Marx', 4, 'Argument Construction\r\nSituation:-\r\nThe director of the local production of La Finestrina says it is as\r\nsimilar to the original production as is possible in a modern\r\ntheater. The actor playing Harlequin gives a performance\r\nreminiscent of Groucho Marx, whose comic style falls within an\r\nacting tradition which began in sixteenth-century Italy.\r\nReasoning:-\r\nFor which of the options would the consideration given best serve\r\nas an argument? The actorâ€™s performance was reminiscent of\r\nsomeone who fell within a tradition going back to sixteenthcentury\r\nItaly. The play was written, and therefore was likely first\r\nperformed, in eighteenth-century Italy. All of this suggests that\r\nthere could be a similarity between the performances of Harlequin\r\nin the local production and in the original production. While the\r\ntwo performances might have been quite dissimilar, there is\r\nnothing here that supports that.\r\nA Regardless of how plausible this option might be on its own merits, the\r\npassage provides no support for it because the passage provides no\r\ninformation about the characteristics of a historically accurate performance\r\nof an eighteenth-century play.\r\nB The passage neither says this nor implies it.\r\nC The passage says nothing about the training of actors, so this option\r\nwould be supported by the passage only in a very roundabout, indirect way.\r\nD Correct. This is the option that the considerations most support.\r\nE That the performance reminded the theater critic of Groucho Marx hardly\r\nshows that the similarity was intentional, let alone that it was at the\r\ndirectorâ€™s instruction.\r\nThe correct answer is D.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(98, '1', '<p>Although the discount stores in Goreville&rsquo;s central shopping district are expected to<br />\r\nclose within five years as a result of competition from a SpendLess discount<br />\r\ndepartment store that just opened, those locations will not stay vacant for long. In<br />\r\nthe five years since the opening of Colson&rsquo;s, a nondiscount department store, a new<br />\r\nstore has opened at the location of every store in the shopping district that closed<br />\r\nbecause it could not compete with Colson&rsquo;s.<br />\r\nWhich of the following, if true, most seriously weakens the argument?</p>\r\n', '(A) Many customers of Colsonâ€™s are expected to do less shopping there than they did before the SpendLess store opened.', ' (B) Increasingly, the stores that have opened in the central shopping district since Colsonâ€™s opened have been discount stores. ', '(C) At present, the central shopping district has as many stores operating in it as it ever had. ', '(D) Over the course of the next five years, it is expected that Gorevilleâ€™s population will grow at a faster rate than it has for the past several decades. ', '(E) Many stores in the central shopping district sell types of merchandise that are not available at either SpendLess or Colsonâ€™s.', 2, 'Argument Evaluation\r\nSituation:-\r\nDue to competition from a recently opened SpendLess discount\r\ndepartment store, discount stores in Gorevilleâ€™s central shopping\r\ndistrict are expected to close within five years. But those locations\r\nwill not be vacant long, for new stores have replaced all those that\r\nclosed because of the opening five years ago of a Colsonâ€™s\r\nnondiscount department store.\r\nReasoning:-\r\nThe question is which option would most weaken the argument?\r\nThe arguer infers that stores that leave because of the SpendLess\r\nwill be replaced in their locations by other stores because that is\r\nwhat happened after the Colsonâ€™s department came in. Since the\r\nreasoning relies on a presumed similarity between the two cases,\r\nany information that brings to light a relevant dissimilarity would\r\nweaken the argument. If the stores that were driven out by\r\nColsonâ€™s were replaced mostly by discount stores, that suggests\r\nthat the stores were replaced because of a need that no longer\r\nexists after the opening of SpendLess.\r\nA The fact that Colsonâ€™s may be seeing fewer customers does not mean that\r\nthe discount stores that close will not be replaced; they might be replaced by\r\nstores that in no way compete with Colsonâ€™s or SpendLess.\r\nB Correct. This option most seriously weakens the argument.\r\nC If anything, this strengthens the argument by indicating that Gorevilleâ€™s\r\ncentral shopping district is thriving.\r\nD This, too, strengthens the argument because one is more likely to open a\r\nnew store in an area with a growing population.\r\nE Because this statement does not indicate whether any of these stores that\r\noffer goods not sold at SpendLess or Colsonâ€™s will be among those that are\r\nclosing, it is not possible to determine what effect it has on the strength of\r\nthe argument.\r\nThe correct answer is B.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
(99, '1', '<p>Last year all refuse collected by Shelbyville city services was incinerated. This<br />\r\nincineration generated a large quantity of residual ash. In order to reduce the<br />\r\namount of residual ash Shelbyville generates this year to half of last year&rsquo;s total,<br />\r\nthe city has revamped its collection program. This year city services will separate<br />\r\nfor recycling enough refuse to reduce the number of truckloads of refuse to be<br />\r\nincinerated to half of last year&rsquo;s number.<br />\r\nWhich of the following is required for the revamped collection program to achieve<br />\r\nits aim?</p>\r\n', 'This year, no materials that city services could separate for recycling will be incinerated. ', 'Separating recyclable materials from materials to be incinerated will cost Shelbyville less than half what it cost last year to dispose of the residual ash. ', 'Refuse collected by city services will contain a larger proportion of recyclable materials this year than it did last year. ', 'The refuse incinerated this year will generate no more residual ash per truckload incinerated than did the refuse incinerated last year. ', 'The total quantity of refuse collected by Shelbyville city services this year will be no greater than that collected last year.', 4, 'A This merely indicates that no further reduction of ash through recycling\r\ncould be achieved this year; it indicates nothing about how much the ash\r\nwill be reduced.\r\nB This suggests a further benefit from recycling, but does not bear on the\r\namount of ash that will be produced.\r\nC Since no information is provided about how much, if any, recyclable\r\nmaterials were removed from the refuse last year, this does not affect the\r\nreasoning.\r\nD Correct. This states a requirement for the collection program to achieve\r\nits aim.\r\nE This is not a requirement because even if the city collects more refuse this\r\nyear, it could still cut in half the amount of residual ash by cutting in half\r\nthe number of truckloads going to the incinerator.\r\nThe correct answer is D.', '1.00', 'yes', '2017-06-16', '0000-00-00', ''),
