(498, '27', '<p>Consider we have a 1-2 Shell and Tube Heat Exchanger with tube diameter 20mm and shell<br />\r\ndiameter 55mm, we have two fluids A &amp; B, A is supply water and B is distilled water, wedesire to have their flow rates as 15m3/s and 21m3/s respectively. Which fluid pass arrangement would be best suited for the HE?</p>\r\n', 'Parallel flow with A in tube and B in the shell side', 'Counter flow with B in tube and A in the shell side', 'Counter flow with A in tube and B in the shell side', 'Parallel flow with B in tube and A in the shell side', '', 2, '', '1.00', 'yes', '2023-04-10', '2023-04-10', ''),
(499, '27', '<p>A stream of hydrocarbon (Cp = 2.2 kJ/kg.K) is cooled at a rate of 720kg/hr from 150 degree c<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">elsius </span></span></span></span> to 40&nbsp;degree c<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">elsius </span></span></span></span> in the tube side of a double pipe counter flow heat exchanger. Water (Cp = 4.18kJ/kg.K) enters the heat exchangers at 10 degree c<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">elsius </span></span></span></span>&nbsp;&nbsp;at a rate of 540kg/hr. The outside diameter of the inner tube is 2.5cm, and its length is 6m. Calculate the overall heat transfer coefficient.</p>\r\n', '5.42kW/m2.K', '2.31kW/m2.K', '8.12kW/m2.K', '1.54 kW/m2.K', '', 2, '', '1.00', 'yes', '2023-04-10', '2023-04-10', ''),
(500, '27', '<p>In a heat exchange between air and liquid across a tube wall, it is proposed to use fins to:</p>\r\n', 'Enhance the overall heat transfer coefficient on gas side', 'Enhance the overall heat transfer coefficient on liquid side', 'Decrease the surface area of the heat exchanger', 'None of the above', '', 1, '', '1.00', 'yes', '2023-04-10', '2023-04-10', ''),
