(504, '27', '<p>Which of the following statement is not true about mass of conservation law</p>\r\n', 'The law of conservation of mass means matter cannot be created or destroyed ', 'The number and type of atoms must be the same for both reactants and products. ', 'The law of conservation of mass is that, in a closed or isolated system, matter  cannot be created or destroyed. ', 'In a chemical reaction, the mass of the products equals the mass of the reactants.', 'None of the above', 5, '', '1.00', 'yes', '2023-04-10', '2023-04-10', ''),
