(613, '33', '<p><span style=\"font-size:12.0pt\"><span style=\"background-color:#fdfdfd\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"color:black\">18. The instruction, ADD 45,R1 does _______(</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'A.	Adds the value of 45 to the address of R1 and stores 45 in that address', 'B.	Adds 45 to the value of R1 and stores it in R1', 'C.	Finds the memory location 45 and adds that content to that of R1', 'D.	None of the mentioned', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-11', '2023-04-11', ''),
