(1009, '51', '<p>If a material fails below its yield point, failure would be due to<br />\r\n&nbsp;</p>\r\n', 'sudden loading', 'Impact loading', 'creep', 'fatigue', '', 4, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1010, '51', '<p>The ability of a material to resist the externally applied forces without breaking or yielding is<br />\r\ncalled.<br />\r\n&nbsp;</p>\r\n', 'Strength', 'Toughness', 'Stiffness', 'Hardness', '', 3, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
