(1013, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which of the following statement is <strong>true</strong> about electrical machine?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'The purpose of DC test is to find the resistance of the winding', 'The purpose of no load test in induction motor is to find the magnetizing impedance', 'The purpose of locked test in induction motor is to find the rotor and the stator impedance ', 'All', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
