(1015, '51', '<p>Strain is defined as the ratio of<br />\r\n&nbsp;</p>\r\n', 'Change in volume to original volume', 'Change in length to original length', 'Change in cross-sectional area to original cross-sectional area', 'Any one of the above', '', 4, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1016, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The critical resistance in DC generator is the resistance of _______</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Armature winding ', 'Field winding', 'External circuit', 'Variable resistance', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1017, '51', '<p>It equal and opposite forces applied to a body tend to elongate it, the stress so produced is<br />\r\ncalled<br />\r\n&nbsp;</p>\r\n', 'Internal resistance', 'Tensilestress', 'Transversestress', 'Compressivestres', '', 2, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1018, '51', '<p>A thin mild steel wire is loaded by adding loads in equal increment still it breaks. The<br />\r\nextensions noted with increasing loads will behave as under<br />\r\n&nbsp;</p>\r\n', 'Uniform throughout', 'Increase uniformly', 'First increase and then decrease', 'Increase uniformly first and then increase rapidly', '', 4, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1019, '51', '<p>If the radius of wire stretched by a load is doubled, then its Young&#39;s modulus will be<br />\r\n&nbsp;</p>\r\n', 'Doubled', 'Halved', 'Become four times', 'Become one fourth', 'Remain unaffected', 5, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1020, '51', '<p>Tensile strength of a material is obtained by dividing the maximum load during the test by<br />\r\nthe<br />\r\n&nbsp;</p>\r\n', 'Area at the time of fracture', 'Original cross-sectional area', 'Average of (a) and (b)', 'Minimum area after fracture', '', 2, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
