(1023, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The long shunt compound DC generator&rsquo;s series field is energized by </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Armature current', 'Load current', 'External current', 'Shunt current', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
