(1025, '51', '<p>A closed system is one in which<br />\r\n&nbsp;</p>\r\n', 'Mass doesn’t cross the boundaries of the system, though energy may do so', 'Mass crosses the boundary but not the energy', 'Neither mass nor energy crosses the boundaries of the system', 'Both energy and mass can cross the boundaries of the system', '', 1, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
(1026, '51', '<p>Thermal conductivity of a material may be defined as the<br />\r\n&nbsp;</p>\r\n', 'Quantity of heat flowing in one second through one cm cube of material when opposite faces are maintained at a temperature difference of 1°C', 'Quantity of heat flowing in one second through a slab of the material of area one cm square, thickness 1 cm when its faces differ in temperature by 1°C', 'Heat conducted in unit time across unit area through unit thickness when a temperature different of unity is maintained between opposite faces', 'All of the above', '', 4, '', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1027, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The&nbsp; shunt&nbsp; DC generator&rsquo;s &nbsp;field winding is energized by </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Armature current', 'Load current', 'External current', 'Shunt current', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1028, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the relation between the torque and the rotor speed in induction motor at high slip region?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Directly proportional', 'They are independent one another', 'Inversely proportional', 'No relation between them', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1029, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is the relation between the torque and the rotor speed in induction motor at low slip region?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Directly proportional', 'They are independent one another', 'Inversely proportional', 'No relation between them', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
