(1034, '51', '<p>For the same compression ratio and for the same heat added<br />\r\n&nbsp;</p>\r\n', 'Otto cycle is more efficient than Diesel cycle', 'Diesel cycle is more efficient than Otto cycle', 'Efficiency depends on other factors', 'Both Otto and Diesel cycles are equally efficient', 'None of the above.', 1, '', '1.50', 'yes', '2023-04-12', '2023-04-12', ''),
