(1093, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What are the various forms of control systems? </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Open-loop and closed-loop ', 'Electrical and mechanical ', 'Analog and digital ', 'Input and output', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1094, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What are the elements of open-loop control systems? </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Sensors, actuators, and controllers ', 'Input, process and output ', 'Feedback loop and error correction ', 'Only a sensor is used', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1095, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What are the elements of closed-loop control systems?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Sensors, actuators, and controllers ', 'Input, process and output ', 'Feedback loop and error correction ', 'Only a sensor is used', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1096, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What the design process is as applied to mechatronics systems? </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'A process of designing only mechanical components ', 'A process of designing only electrical components', 'A process of designing only computational components ', 'A process of designing integrated electrical, mechanical and computational components', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1097, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">What is signal conditioning? </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'The process of designing sensors for measurement systems ', 'The process of removing noise and amplifying signals from sensors ', 'The process of data acquisition and processing ', 'The process of controlling a system using feedback loops', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1098, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which of the following statements is true regarding electromechanical devices?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'a)	Electromechanical devices use purely electrical energy to perform mechanical tasks.', 'b)	Electrical and mechanical actuation systems are not considered types of electromechanical devices.', 'Electromechanical devices use a combination of electrical and mechanical energy to perform tasks.', 'Electromechanical devices are exclusively used in mechanical engineering applications.', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1099, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which of the following is a component of a microprocessor system?</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Keyboard', 'mouse', 'Monitor', 'Central Processing Unit (CPU)', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1100, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Which of the following error is caused by poor calibration of an instrument?</span></span></span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Random Error', 'Systematic Error', 'Gross Error', 'Precision Error', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1101, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">____________ is an instrument which measures the insulation resistance of an electric circuit relative to earth and one another. </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Tangent galvanometer ', 'Megger ', 'Current transformer ', 'Ballistic galvanometer', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1102, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">An ammeter is </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Secondary Instrument ', 'Absolute Instrument ', 'Recording Instrument ', 'Integrating Instrument', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1103, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">For measuring a very high resistance we should use </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Kelvin\'s double bridge ', 'Wheatstone bridge ', 'Substitution Method', 'Direct Deflection Method', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1104, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">It is required to measure the true open circuit e.m.f. of a battery. The best device is </span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'D.C. voltmeter ', 'Ammeter and a known resistance ', 'D.C. potentiometer ', 'Loss of Charge Method', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1105, '52', '<p><span style=\"font-size:11pt\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">In 3 phase power measurement by two watt meter methods reading can be same in both wattmeters then the power factor is____.&nbsp;</span></span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Leading', 'Lagging', 'Unity', 'Zero', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1106, '52', '<p><span style=\"font-size:11pt\"><span style=\"color:black\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">How many wattmeter(s) is required to measure 6 &ndash; phase, 6 &ndash; wire without neutral wire system?&nbsp;</span></span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '3', '4', '5', '6', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1107, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Identify most suitable definition of a transducer.</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'A transducer is a device that converts energy from one form to another.', 'Transducer is a device which converts mechanical energy into electrical energy.', 'A Transducer is a device which converts electrical energy into mechanical energy.', 'Transducer is a device which converts physical quantity into electrical quantity.', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1108, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">_________is a&nbsp;self-generating type transducer&nbsp;that can produce an electrical voltage or current output without utilizing any external power source.</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'A passive transducer', 'An active transducer', 'A primary transducer', 'A secondary transducer', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1109, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Which of the following pair is an active transducer?</span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Strain gauge, LVDT', 'Inductive proximity sensor, Solar cell', 'thermocouple, LVDT', 'Thermocouple, solar cell', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1110, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Identify the pair of Passive transducers.</span></span></p>\r\n', 'LDR (Light Dependent Resistor), Solar cell', 'Thermistor, Thermocouple', 'LVDT (Linear Variable Differential Transformer), Strain Gauge', 'Solar cell, Thermocouple', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1111, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Transducers, on the basis of nature of output signal, may be classified into</span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'primary and secondary transducers', 'active and passive transducers', 'electrical and inverse transducers', 'analog and digital transducers', '', 4, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1112, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The ratio of the specific weight of a liquid to the specific weight of pure water at a standard temperature is called as</span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Density', 'Specific Gravity', 'Mass density', 'Surface Tension', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1113, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">In a portable instrument, the controlling torque is provided by </span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'Spring', 'Gravity', 'Eddy Currents ', 'Specific Gravity', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1114, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A tachometer encoder can be used for measurement of speed:</span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'of false pulses because of electrical noise', 'in forward and reverse directions', 'in one direction only', 'for single revolution in a multiple track', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', '');
