(1115, '52', '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The inductive level transducers are mainly used for measurement of level of liquids which are</span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'non-conductive', 'Conductive ', 'Radiative ', 'Viscouse', '', 2, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1116, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">In variable dielectric constant method of liquid measurement, if the liquid is non-conductive. The electrode and the tank wall form the plates of a parallel plate capacitor with ____acting as the dielectric.</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'plastic insulated electrode', 'insulated tank wall of metal', 'the liquid in between them', 'None of them', '', 3, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1117, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The output of a flowmeter based on electromagnetic induction has</span></span></span></span></p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', 'variable frequency', 'variable amplitude', 'variable frequency and amplitude', 'variable dc amplitude', '', 1, '<p>&nbsp;</p>\r\n<quillbot-extension-portal></quillbot-extension-portal>', '1.00', 'yes', '2023-04-12', '2023-04-12', ''),
(1118, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">RTD stands for:</span></span></span></span></p>\r\n', 'Resistance Temperature Deflector', 'Resistance Transfer Deflector ', 'Resistance Temperature Detector', 'Resistance Transfer Detector', '', 3, '', '2.00', 'yes', '2023-04-13', '2023-04-13', ''),
(1119, '52', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">The capacitive transducers are normally&nbsp;used for:&nbsp;</span></span></span></span></p>\r\n', 'static and dynamic both', 'transient measurements', 'static measurements  ', 'dynamic measurements', '', 1, '', '2.00', 'yes', '2023-04-13', '2023-04-13', '');
